import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Components/home/Home";

function App() {
    return (
        <div>

            <BrowserRouter>
                <Routes>
                    <Route path = {"/"} component={<Home/>}/>
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
